import './App.css';
import DashBoard from './components/DashBoard';
import Header from './components/Header';
import SideBar from './components/SideBar'
function App() {
  return (
    <div className="App">
      <body className='container'>
      <Header></Header>
      <main>
        <div className='Page'>

          <SideBar></SideBar>
        <div className='CustomBody'>
           <p className="Dashboard">DashBoard</p>
          <DashBoard></DashBoard>
        </div>
        </div>

      </main>
      </body>
    </div>
  );
}

export default App;
